# fn generate_workout(intensity: u32, random_number: u32) { let expensive_result = simulated_expensive_calculation(intensity); if intensity < 25 { println!("Today, do {} pushups!", expensive_result); println!("Next, do {} situps!", expensive_result); } else { if random_number == 3 { println!("Take a break today! Remember to stay hydrated!"); } else { println!("Today, run for {} minutes!", expensive_result); } }
}
# # fn main() {
# let simulated_user_specified_value = 10;
# let simulated_random_number = 7;
# # generate_workout(simulated_user_specified_value, simulated_random_number);
# } 範例 13-4: Extracting the calls to simulated_expensive_calculation to one place and storing the result in the expensive_result variable This change unifies all the calls to simulated_expensive_calculation and solves the problem of the first if block unnecessarily calling the function twice. Unfortunately, we’re now calling this function and waiting for the result in all cases, which includes the inner if block that doesn’t use the result value at all. We want to define code in one place in our program, but only execute that code where we actually need the result. This is a use case for closures! Refactoring with Closures to Store Code Instead of always calling the simulated_expensive_calculation function before the if blocks, we can define a closure and store the closure in a variable rather than storing the result of the function call, as shown in Listing 13-5. We can actually move the whole body of simulated_expensive_calculation within the closure we’re introducing here. 檔案名稱：src/main.rs # use std::thread;
# use std::time::Duration;
# # fn generate_workout(intensity: u32, random_number: u32) { let expensive_closure = |num| { println!("calculating slowly..."); thread::sleep(Duration::from_secs(2)); num };
# # if intensity < 25 {
# println!("Today, do {} pushups!", expensive_closure(intensity));
# println!("Next, do {} situps!", expensive_closure(intensity));
# } else {
# if random_number == 3 {
# println!("Take a break today! Remember to stay hydrated!");
# } else {
# println!(
# "Today, run for {} minutes!",
# expensive_closure(intensity)
# );
# }
# }
# }
# # fn main() {
# let simulated_user_specified_value = 10;
# let simulated_random_number = 7;
# # generate_workout(simulated_user_specified_value, simulated_random_number);
# } 範例 13-5: Defining a closure and storing it in the expensive_closure variable The closure definition comes after the = to assign it to the variable expensive_closure. To define a closure, we start with a pair of vertical pipes (|), inside which we specify the parameters to the closure; this syntax was chosen because of its similarity to closure definitions in Smalltalk and Ruby. This closure has one parameter named num: if we had more than one parameter, we would separate them with commas, like |param1, param2|. After the parameters, we place curly brackets that hold the body of the closure—these are optional if the closure body is a single expression. The end of the closure, after the curly brackets, needs a semicolon to complete the let statement. The value returned from the last line in the closure body (num) will be the value returned from the closure when it’s called, because that line doesn’t end in a semicolon; just as in function bodies. Note that this let statement means expensive_closure contains the definition of an anonymous function, not the resulting value of calling the anonymous function. Recall that we’re using a closure because we want to define the code to call at one point, store that code, and call it at a later point; the code we want to call is now stored in expensive_closure. With the closure defined, we can change the code in the if blocks to call the closure to execute the code and get the resulting value. We call a closure like we do a function: we specify the variable name that holds the closure definition and follow it with parentheses containing the argument values we want to use, as shown in Listing 13-6. 檔案名稱：src/main.rs # use std::thread;
# use std::time::Duration;
# fn generate_workout(intensity: u32, random_number: u32) { let expensive_closure = |num| { println!("calculating slowly..."); thread::sleep(Duration::from_secs(2)); num }; if intensity < 25 { println!("Today, do {} pushups!", expensive_closure(intensity)); println!("Next, do {} situps!", expensive_closure(intensity)); } else { if random_number == 3 { println!("Take a break today! Remember to stay hydrated!"); } else { println!( "Today, run for {} minutes!", expensive_closure(intensity) ); } }
