We’ve shown that you can create an iterator by calling iter, into_iter, or iter_mut on a vector. You can create iterators from the other collection types in the standard library, such as hash map. You can also create iterators that do anything you want by implementing the Iterator trait on your own types. As previously mentioned, the only method you’re required to provide a definition for is the next method. Once you’ve done that, you can use all other methods that have default implementations provided by the Iterator trait! To demonstrate, let’s create an iterator that will only ever count from 1 to 5. First, we’ll create a struct to hold some values. Then we’ll make this struct into an iterator by implementing the Iterator trait and using the values in that implementation. Listing 13-20 has the definition of the Counter struct and an associated new function to create instances of Counter: 檔案名稱：src/lib.rs struct Counter { count: u32,
} impl Counter { fn new() -> Counter { Counter { count: 0 } }
} fn main() {} 範例 13-20: Defining the Counter struct and a new function that creates instances of Counter with an initial value of 0 for count The Counter struct has one field named count. This field holds a u32 value that will keep track of where we are in the process of iterating from 1 to 5. The count field is private because we want the implementation of Counter to manage its value. The new function enforces the behavior of always starting new instances with a value of 0 in the count field. Next, we’ll implement the Iterator trait for our Counter type by defining the body of the next method to specify what we want to happen when this iterator is used, as shown in Listing 13-21: 檔案名稱：src/lib.rs # struct Counter {
# count: u32,
# }
# # impl Counter {
# fn new() -> Counter {
# Counter { count: 0 }
# }
# }
# impl Iterator for Counter { type Item = u32; fn next(&mut self) -> Option<Self::Item> { if self.count < 5 { self.count += 1; Some(self.count) } else { None } }
}
# # fn main() {} 範例 13-21: Implementing the Iterator trait on our Counter struct We set the associated Item type for our iterator to u32, meaning the iterator will return u32 values. Again, don’t worry about associated types yet, we’ll cover them in Chapter 19. We want our iterator to add 1 to the current state, so we initialized count to 0 so it would return 1 first. If the value of count is less than 5, next will increment count and return the current value wrapped in Some. Once count is 5, our iterator will stop incrementing count and always return None. Using Our Counter Iterator’s next Method Once we’ve implemented the Iterator trait, we have an iterator! Listing 13-22 shows a test demonstrating that we can use the iterator functionality of our Counter struct by calling the next method on it directly, just as we did with the iterator created from a vector in Listing 13-15. 檔案名稱：src/lib.rs # struct Counter {
# count: u32,
# }
# # impl Counter {
# fn new() -> Counter {
# Counter { count: 0 }
# }
# }
# # impl Iterator for Counter {
# type Item = u32;
# # fn next(&mut self) -> Option<Self::Item> {
# if self.count < 5 {
# self.count += 1;
# Some(self.count)
# } else {
# None
# }
# }
# }
# # #[cfg(test)]
# mod tests {
# use super::*;
# #[test] fn calling_next_directly() { let mut counter = Counter::new(); assert_eq!(counter.next(), Some(1)); assert_eq!(counter.next(), Some(2)); assert_eq!(counter.next(), Some(3)); assert_eq!(counter.next(), Some(4)); assert_eq!(counter.next(), Some(5)); assert_eq!(counter.next(), None); }
# }
# # fn main() {} 範例 13-22: Testing the functionality of the next method implementation This test creates a new Counter instance in the counter variable and then calls next repeatedly, verifying that we have implemented the behavior we want this iterator to have: returning the values from 1 to 5. Using Other Iterator Trait Methods We implemented the Iterator trait by defining the next method, so we can now use any Iterator trait method’s default implementations as defined in the standard library, because they all use the next method’s functionality. For example, if for some reason we wanted to take the values produced by an instance of Counter, pair them with values produced by another Counter instance after skipping the first value, multiply each pair together, keep only those results that are divisible by 3, and add all the resulting values together, we could do so, as shown in the test in Listing 13-23: 檔案名稱：src/lib.rs # struct Counter {
# count: u32,
# }
# # impl Counter {
# fn new() -> Counter {
# Counter { count: 0 }
# }
# }
# # impl Iterator for Counter {
# type Item = u32;
# # fn next(&mut self) -> Option<Self::Item> {
# if self.count < 5 {
# self.count += 1;
# Some(self.count)
# } else {
# None
# }
# }
# }
# # #[cfg(test)]
# mod tests {
# use super::*;
# # #[test]
# fn calling_next_directly() {
# let mut counter = Counter::new();
# # assert_eq!(counter.next(), Some(1));
# assert_eq!(counter.next(), Some(2));
# assert_eq!(counter.next(), Some(3));
# assert_eq!(counter.next(), Some(4));
# assert_eq!(counter.next(), Some(5));
# assert_eq!(counter.next(), None);
# }
# #[test] fn using_other_iterator_trait_methods() { let sum: u32 = Counter::new() .zip(Counter::new().skip(1)) .map(|(a, b)| a * b) .filter(|x| x % 3 == 0) .sum(); assert_eq!(18, sum); }
# }
# # fn main() {} 範例 13-23: Using a variety of Iterator trait methods on our Counter iterator Note that zip produces only four pairs; the theoretical fifth pair (5, None) is never produced because zip returns None when either of its input iterators return None. All of these method calls are possible because we specified how the next method works, and the standard library provides default implementations for other methods that call next.

