58 | self.sent_messages.push(String::from(message)); | ^^^^^^^^^^^^^^^^^^ `self` is a `&` reference, so the data it refers to cannot be borrowed as mutable error: aborting due to previous error For more information about this error, try `rustc --explain E0596`.
error: could not compile `limit-tracker`. To learn more, run the command again with --verbose. We can’t modify the MockMessenger to keep track of the messages, because the send method takes an immutable reference to self. We also can’t take the suggestion from the error text to use &mut self instead, because then the signature of send wouldn’t match the signature in the Messenger trait definition (feel free to try and see what error message you get). This is a situation in which interior mutability can help! We’ll store the sent_messages within a RefCell<T>, and then the send message will be able to modify sent_messages to store the messages we’ve seen. Listing 15-22 shows what that looks like: 檔案名稱：src/lib.rs # pub trait Messenger {
