10 | let mut num = counter.lock().unwrap(); | ------- use occurs due to use in closure error: aborting due to previous error For more information about this error, try `rustc --explain E0382`.
error: could not compile `shared-state`. To learn more, run the command again with --verbose. The error message states that the counter value was moved in the previous iteration of the loop. So Rust is telling us that we can’t move the ownership of lock counter into multiple threads. Let’s fix the compiler error with a multiple-ownership method we discussed in Chapter 15. Multiple Ownership with Multiple Threads In Chapter 15, we gave a value multiple owners by using the smart pointer Rc<T> to create a reference counted value. Let’s do the same here and see what happens. We’ll wrap the Mutex<T> in Rc<T> in Listing 16-14 and clone the Rc<T> before moving ownership to the thread. Now that we’ve seen the errors, we’ll also switch back to using the for loop, and we’ll keep the move keyword with the closure. 檔案名稱：src/main.rs use std::rc::Rc;
