# # pub fn approve(&mut self) {
# if let Some(s) = self.state.take() {
# self.state = Some(s.approve())
# }
# }
}
# # trait State {
# fn request_review(self: Box<Self>) -> Box<dyn State>;
# fn approve(self: Box<Self>) -> Box<dyn State>;
# }
# # struct Draft {}
# # impl State for Draft {
# fn request_review(self: Box<Self>) -> Box<dyn State> {
# Box::new(PendingReview {})
# }
# # fn approve(self: Box<Self>) -> Box<dyn State> {
# self
# }
# }
# # struct PendingReview {}
# # impl State for PendingReview {
# fn request_review(self: Box<Self>) -> Box<dyn State> {
# self
# }
# # fn approve(self: Box<Self>) -> Box<dyn State> {
# Box::new(Published {})
# }
# }
# # struct Published {}
# # impl State for Published {
# fn request_review(self: Box<Self>) -> Box<dyn State> {
# self
# }
# # fn approve(self: Box<Self>) -> Box<dyn State> {
# self
# }
# } 範例 17-17: Updating the content method on Post to delegate to a content method on State Because the goal is to keep all these rules inside the structs that implement State, we call a content method on the value in state and pass the post instance (that is, self) as an argument. Then we return the value that is returned from using the content method on the state value. We call the as_ref method on the Option because we want a reference to the value inside the Option rather than ownership of the value. Because state is an Option<Box<dyn State>>, when we call as_ref, an Option<&Box<dyn State>> is returned. If we didn’t call as_ref, we would get an error because we can’t move state out of the borrowed &self of the function parameter. We then call the unwrap method, which we know will never panic, because we know the methods on Post ensure that state will always contain a Some value when those methods are done. This is one of the cases we talked about in the “Cases In Which You Have More Information Than the Compiler” section of Chapter 9 when we know that a None value is never possible, even though the compiler isn’t able to understand that. At this point, when we call content on the &Box<dyn State>, deref coercion will take effect on the & and the Box so the content method will ultimately be called on the type that implements the State trait. That means we need to add content to the State trait definition, and that is where we’ll put the logic for what content to return depending on which state we have, as shown in Listing 17-18: 檔案名稱：src/lib.rs # pub struct Post {
