Function parameters can also be patterns. The code in Listing 18-6, which declares a function named foo that takes one parameter named x of type i32, should by now look familiar. fn foo(x: i32) { // code goes here
}
# # fn main() {} 範例 18-6: A function signature uses patterns in the parameters The x part is a pattern! As we did with let, we could match a tuple in a function’s arguments to the pattern. Listing 18-7 splits the values in a tuple as we pass it to a function. 檔案名稱：src/main.rs fn print_coordinates(&(x, y): &(i32, i32)) { println!("Current location: ({}, {})", x, y);
} fn main() { let point = (3, 5); print_coordinates(&point);
} 範例 18-7: A function with parameters that destructure a tuple This code prints Current location: (3, 5). The values &(3, 5) match the pattern &(x, y), so x is the value 3 and y is the value 5. We can also use patterns in closure parameter lists in the same way as in function parameter lists, because closures are similar to functions, as discussed in Chapter 13. At this point, you’ve seen several ways of using patterns, but patterns don’t work the same in every place we can use them. In some places, the patterns must be irrefutable; in other circumstances, they can be refutable. We’ll discuss these two concepts next.

331.body:
Patterns come in two forms: refutable and irrefutable. Patterns that will match for any possible value passed are irrefutable . An example would be x in the statement let x = 5; because x matches anything and therefore cannot fail to match. Patterns that can fail to match for some possible value are refutable . An example would be Some(x) in the expression if let Some(x) = a_value because if the value in the a_value variable is None rather than Some, the Some(x) pattern will not match. Function parameters, let statements, and for loops can only accept irrefutable patterns, because the program cannot do anything meaningful when values don’t match. The if let and while let expressions accept refutable and irrefutable patterns, but the compiler warns against irrefutable patterns because by definition they’re intended to handle possible failure: the functionality of a conditional is in its ability to perform differently depending on success or failure. In general, you shouldn’t have to worry about the distinction between refutable and irrefutable patterns; however, you do need to be familiar with the concept of refutability so you can respond when you see it in an error message. In those cases, you’ll need to change either the pattern or the construct you’re using the pattern with, depending on the intended behavior of the code. Let’s look at an example of what happens when we try to use a refutable pattern where Rust requires an irrefutable pattern and vice versa. Listing 18-8 shows a let statement, but for the pattern we’ve specified Some(x), a refutable pattern. As you might expect, this code will not compile. # fn main() {
# let some_option_value: Option<i32> = None; let Some(x) = some_option_value;
# } 範例 18-8: Attempting to use a refutable pattern with let If some_option_value was a None value, it would fail to match the pattern Some(x), meaning the pattern is refutable. However, the let statement can only accept an irrefutable pattern because there is nothing valid the code can do with a None value. At compile time, Rust will complain that we’ve tried to use a refutable pattern where an irrefutable pattern is required: $ cargo run Compiling patterns v0.1.0 (file:///projects/patterns)
error[E0005]: refutable pattern in local binding: `None` not covered --> src/main.rs:3:9 |
3 | let Some(x) = some_option_value; | ^^^^^^^ pattern `None` not covered | = note: `let` bindings require an "irrefutable pattern", like a `struct` or an `enum` with only one variant = note: for more information, visit https://doc.rust-lang.org/book/ch18-02-refutability.html
help: you might want to use `if let` to ignore the variant that isn't matched |
3 | if let Some(x) = some_option_value { /* */ } | error: aborting due to previous error For more information about this error, try `rustc --explain E0005`.
error: could not compile `patterns`. To learn more, run the command again with --verbose. Because we didn’t cover (and couldn’t cover!) every valid value with the pattern Some(x), Rust rightfully produces a compiler error. To fix the problem where we have a refutable pattern where an irrefutable pattern is needed, we can change the code that uses the pattern: instead of using let, we can use if let. Then if the pattern doesn’t match, the code will just skip the code in the curly brackets, giving it a way to continue validly. Listing 18-9 shows how to fix the code in Listing 18-8. # fn main() {
# let some_option_value: Option<i32> = None; if let Some(x) = some_option_value { println!("{}", x); }
# } 範例 18-9: Using if let and a block with refutable patterns instead of let We’ve given the code an out! This code is perfectly valid, although it means we cannot use an irrefutable pattern without receiving an error. If we give if let a pattern that will always match, such as x, as shown in Listing 18-10, the compiler will give a warning. # fn main() { if let x = 5 { println!("{}", x); };
# } 範例 18-10: Attempting to use an irrefutable pattern with if let Rust complains that it doesn’t make sense to use if let with an irrefutable pattern: $ cargo run Compiling patterns v0.1.0 (file:///projects/patterns)
warning: irrefutable if-let pattern --> src/main.rs:2:5 |
2 | / if let x = 5 {
3 | | println!("{}", x);
4 | | }; | |_____^ | = note: `#[warn(irrefutable_let_patterns)]` on by default Finished dev [unoptimized + debuginfo] target(s) in 0.39s Running `target/debug/patterns`
5 For this reason, match arms must use refutable patterns, except for the last arm, which should match any remaining values with an irrefutable pattern. Rust allows us to use an irrefutable pattern in a match with only one arm, but this syntax isn’t particularly useful and could be replaced with a simpler let statement. Now that you know where to use patterns and the difference between refutable and irrefutable patterns, let’s cover all the syntax we can use to create patterns.

336.body:
The ..= syntax allows us to match to an inclusive range of values. In the following code, when a pattern matches any of the values within the range, that arm will execute: # fn main() { let x = 5; match x { 1..=5 => println!("one through five"), _ => println!("something else"), }
# } If x is 1, 2, 3, 4, or 5, the first arm will match. This syntax is more convenient than using the | operator to express the same idea; instead of 1..=5, we would have to specify 1 | 2 | 3 | 4 | 5 if we used |. Specifying a range is much shorter, especially if we want to match, say, any number between 1 and 1,000! Ranges are only allowed with numeric values or char values, because the compiler checks that the range isn’t empty at compile time. The only types for which Rust can tell if a range is empty or not are char and numeric values. Here is an example using ranges of char values: # fn main() { let x = 'c'; match x { 'a'..='j' => println!("early ASCII letter"), 'k'..='z' => println!("late ASCII letter"), _ => println!("something else"), }
# } Rust can tell that c is within the first pattern’s range and prints early ASCII letter.

