Nothing in Rust prevents a trait from having a method with the same name as another trait’s method, nor does Rust prevent you from implementing both traits on one type. It’s also possible to implement a method directly on the type with the same name as methods from traits. When calling methods with the same name, you’ll need to tell Rust which one you want to use. Consider the code in Listing 19-16 where we’ve defined two traits, Pilot and Wizard, that both have a method called fly. We then implement both traits on a type Human that already has a method named fly implemented on it. Each fly method does something different. 檔案名稱：src/main.rs trait Pilot { fn fly(&self);
} trait Wizard { fn fly(&self);
} struct Human; impl Pilot for Human { fn fly(&self) { println!("This is your captain speaking."); }
} impl Wizard for Human { fn fly(&self) { println!("Up!"); }
} impl Human { fn fly(&self) { println!("*waving arms furiously*"); }
}
# # fn main() {} 範例 19-16: Two traits are defined to have a fly method and are implemented on the Human type, and a fly method is implemented on Human directly When we call fly on an instance of Human, the compiler defaults to calling the method that is directly implemented on the type, as shown in Listing 19-17. 檔案名稱：src/main.rs # trait Pilot {
# fn fly(&self);
# }
# # trait Wizard {
# fn fly(&self);
# }
# # struct Human;
# # impl Pilot for Human {
# fn fly(&self) {
# println!("This is your captain speaking.");
# }
# }
