# }
# }
# # impl Human {
# fn fly(&self) {
# println!("*waving arms furiously*");
# }
# }
# fn main() { let person = Human; person.fly();
} 範例 19-17: Calling fly on an instance of Human Running this code will print *waving arms furiously*, showing that Rust called the fly method implemented on Human directly. To call the fly methods from either the Pilot trait or the Wizard trait, we need to use more explicit syntax to specify which fly method we mean. Listing 19-18 demonstrates this syntax. 檔案名稱：src/main.rs # trait Pilot {
# fn fly(&self);
# }
# # trait Wizard {
# fn fly(&self);
# }
# # struct Human;
# # impl Pilot for Human {
# fn fly(&self) {
# println!("This is your captain speaking.");
# }
# }
# # impl Wizard for Human {
# fn fly(&self) {
# println!("Up!");
# }
# }
# # impl Human {
# fn fly(&self) {
# println!("*waving arms furiously*");
# }
# }
# fn main() { let person = Human; Pilot::fly(&person); Wizard::fly(&person); person.fly();
} 範例 19-18: Specifying which trait’s fly method we want to call Specifying the trait name before the method name clarifies to Rust which implementation of fly we want to call. We could also write Human::fly(&person), which is equivalent to the person.fly() that we used in Listing 19-18, but this is a bit longer to write if we don’t need to disambiguate. Running this code prints the following: $ cargo run Compiling traits-example v0.1.0 (file:///projects/traits-example) Finished dev [unoptimized + debuginfo] target(s) in 0.46s Running `target/debug/traits-example`
This is your captain speaking.
Up!
*waving arms furiously* Because the fly method takes a self parameter, if we had two types that both implement one trait , Rust could figure out which implementation of a trait to use based on the type of self. However, associated functions that are part of traits don’t have a self parameter. When two types in the same scope implement that trait, Rust can’t figure out which type you mean unless you use fully qualified syntax . For example, the Animal trait in Listing 19-19 has the associated function baby_name, the implementation of Animal for the struct Dog, and the associated function baby_name defined on Dog directly. 檔案名稱：src/main.rs trait Animal { fn baby_name() -> String;
} struct Dog; impl Dog { fn baby_name() -> String { String::from("Spot") }
} impl Animal for Dog { fn baby_name() -> String { String::from("puppy") }
} fn main() { println!("A baby dog is called a {}", Dog::baby_name());
} 範例 19-19: A trait with an associated function and a type with an associated function of the same name that also implements the trait This code is for an animal shelter that wants to name all puppies Spot, which is implemented in the baby_name associated function that is defined on Dog. The Dog type also implements the trait Animal, which describes characteristics that all animals have. Baby dogs are called puppies, and that is expressed in the implementation of the Animal trait on Dog in the baby_name function associated with the Animal trait. In main, we call the Dog::baby_name function, which calls the associated function defined on Dog directly. This code prints the following: $ cargo run Compiling traits-example v0.1.0 (file:///projects/traits-example) Finished dev [unoptimized + debuginfo] target(s) in 0.54s Running `target/debug/traits-example`
A baby dog is called a Spot This output isn’t what we wanted. We want to call the baby_name function that is part of the Animal trait that we implemented on Dog so the code prints A baby dog is called a puppy. The technique of specifying the trait name that we used in Listing 19-18 doesn’t help here; if we change main to the code in Listing 19-20, we’ll get a compilation error. 檔案名稱：src/main.rs # trait Animal {
