...
20 | println!("A baby dog is called a {}", Animal::baby_name()); | ^^^^^^^^^^^^^^^^^ cannot infer type | = note: cannot resolve `_: Animal` error: aborting due to previous error For more information about this error, try `rustc --explain E0283`.
error: could not compile `traits-example`. To learn more, run the command again with --verbose. To disambiguate and tell Rust that we want to use the implementation of Animal for Dog, we need to use fully qualified syntax. Listing 19-21 demonstrates how to use fully qualified syntax. 檔案名稱：src/main.rs # trait Animal {
