Rust has a special type named ! that’s known in type theory lingo as the empty type because it has no values. We prefer to call it the never type because it stands in the place of the return type when a function will never return. Here is an example: fn bar() -> ! { // --snip--
# panic!();
}
# # fn main() {} This code is read as “the function bar returns never.” Functions that return never are called diverging functions . We can’t create values of the type ! so bar can never possibly return. But what use is a type you can never create values for? Recall the code from Listing 2-5; we’ve reproduced part of it here in Listing 19-26. # use rand::Rng;
# use std::cmp::Ordering;
# use std::io;
# # fn main() {
# println!("Guess the number!");
# # let secret_number = rand::thread_rng().gen_range(1, 101);
# # println!("The secret number is: {}", secret_number);
# # loop {
# println!("Please input your guess.");
# # let mut guess = String::new();
# # // --snip--
# # io::stdin()
# .read_line(&mut guess)
# .expect("Failed to read line");
# let guess: u32 = match guess.trim().parse() { Ok(num) => num, Err(_) => continue, };
# # println!("You guessed: {}", guess);
# # // --snip--
# # match guess.cmp(&secret_number) {
# Ordering::Less => println!("Too small!"),
# Ordering::Greater => println!("Too big!"),
# Ordering::Equal => {
# println!("You win!");
# break;
# }
# }
# }
# } 範例 19-26: A match with an arm that ends in continue At the time, we skipped over some details in this code. In Chapter 6 in “The match Control Flow Operator” section, we discussed that match arms must all return the same type. So, for example, the following code doesn’t work: # fn main() {
# let guess = "3"; let guess = match guess.trim().parse() { Ok(_) => 5, Err(_) => "hello", };
# } The type of guess in this code would have to be an integer and a string, and Rust requires that guess have only one type. So what does continue return? How were we allowed to return a u32 from one arm and have another arm that ends with continue in Listing 19-26? As you might have guessed, continue has a ! value. That is, when Rust computes the type of guess, it looks at both match arms, the former with a value of u32 and the latter with a ! value. Because ! can never have a value, Rust decides that the type of guess is u32. The formal way of describing this behavior is that expressions of type ! can be coerced into any other type. We’re allowed to end this match arm with continue because continue doesn’t return a value; instead, it moves control back to the top of the loop, so in the Err case, we never assign a value to guess. The never type is useful with the panic! macro as well. Remember the unwrap function that we call on Option<T> values to produce a value or panic? Here is its definition: # enum Option<T> {
# Some(T),
# None,
# }
# # use crate::Option::*;
# impl<T> Option<T> { pub fn unwrap(self) -> T { match self { Some(val) => val, None => panic!("called `Option::unwrap()` on a `None` value"), } }
} In this code, the same thing happens as in the match in Listing 19-26: Rust sees that val has the type T and panic! has the type !, so the result of the overall match expression is T. This code works because panic! doesn’t produce a value; it ends the program. In the None case, we won’t be returning a value from unwrap, so this code is valid. One final expression that has the type ! is a loop: # fn main() { print!("forever "); loop { print!("and ever "); }
# } Here, the loop never ends, so ! is the value of the expression. However, this wouldn’t be true if we included a break, because the loop would terminate when it got to the break.

