# fn handle_connection(mut stream: TcpStream) { let mut buffer = [0; 1024]; stream.read(&mut buffer).unwrap(); let contents = fs::read_to_string("hello.html").unwrap(); let response = format!( "HTTP/1.1 200 OK\r\nContent-Length: {}\r\n\r\n{}", contents.len(), contents ); stream.write(response.as_bytes()).unwrap(); stream.flush().unwrap();
} 範例 20-5: Sending the contents of hello.html as the body of the response We’ve added a line at the top to bring the standard library’s filesystem module into scope. The code for reading the contents of a file to a string should look familiar; we used it in Chapter 12 when we read the contents of a file for our I/O project in Listing 12-4. Next, we use format! to add the file’s contents as the body of the success response. To ensure a valid HTTP response, we add the Content-Length header which is set to the size of our response body, in this case the size of hello.html. Run this code with cargo run and load 127.0.0.1:7878 in your browser; you should see your HTML rendered! Currently, we’re ignoring the request data in buffer and just sending back the contents of the HTML file unconditionally. That means if you try requesting 127.0.0.1:7878/something-else in your browser, you’ll still get back this same HTML response. Our server is very limited and is not what most web servers do. We want to customize our responses depending on the request and only send back the HTML file for a well-formed request to / .

380.body:
Right now, our web server will return the HTML in the file no matter what the client requested. Let’s add functionality to check that the browser is requesting / before returning the HTML file and return an error if the browser requests anything else. For this we need to modify handle_connection, as shown in Listing 20-6. This new code checks the content of the request received against what we know a request for / looks like and adds if and else blocks to treat requests differently. 檔案名稱：src/main.rs # use std::fs;
# use std::io::prelude::*;
# use std::net::TcpListener;
# use std::net::TcpStream;
# # fn main() {
# let listener = TcpListener::bind("127.0.0.1:7878").unwrap();
# # for stream in listener.incoming() {
# let stream = stream.unwrap();
# # handle_connection(stream);
# }
# }
# // --snip-- fn handle_connection(mut stream: TcpStream) { let mut buffer = [0; 1024]; stream.read(&mut buffer).unwrap(); let get = b"GET / HTTP/1.1\r\n"; if buffer.starts_with(get) { let contents = fs::read_to_string("hello.html").unwrap(); let response = format!( "HTTP/1.1 200 OK\r\nContent-Length: {}\r\n\r\n{}", contents.len(), contents ); stream.write(response.as_bytes()).unwrap(); stream.flush().unwrap(); } else { // some other request }
} 範例 20-6: Matching the request and handling requests to / differently from other requests First, we hardcode the data corresponding to the / request into the get variable. Because we’re reading raw bytes into the buffer, we transform get into a byte string by adding the b"" byte string syntax at the start of the content data. Then we check whether buffer starts with the bytes in get. If it does, it means we’ve received a well-formed request to / , which is the success case we’ll handle in the if block that returns the contents of our HTML file. If buffer does not start with the bytes in get, it means we’ve received some other request. We’ll add code to the else block in a moment to respond to all other requests. Run this code now and request 127.0.0.1:7878 ; you should get the HTML in hello.html . If you make any other request, such as 127.0.0.1:7878/something-else , you’ll get a connection error like those you saw when running the code in Listing 20-1 and Listing 20-2. Now let’s add the code in Listing 20-7 to the else block to return a response with the status code 404, which signals that the content for the request was not found. We’ll also return some HTML for a page to render in the browser indicating the response to the end user. 檔案名稱：src/main.rs # use std::fs;
# use std::io::prelude::*;
# use std::net::TcpListener;
# use std::net::TcpStream;
# # fn main() {
# let listener = TcpListener::bind("127.0.0.1:7878").unwrap();
# # for stream in listener.incoming() {
# let stream = stream.unwrap();
# # handle_connection(stream);
# }
# }
# # fn handle_connection(mut stream: TcpStream) {
# let mut buffer = [0; 1024];
# stream.read(&mut buffer).unwrap();
# # let get = b"GET / HTTP/1.1\r\n";
# # if buffer.starts_with(get) {
# let contents = fs::read_to_string("hello.html").unwrap();
# # let response = format!(
# "HTTP/1.1 200 OK\r\nContent-Length: {}\r\n\r\n{}",
# contents.len(),
# contents
# );
# # stream.write(response.as_bytes()).unwrap();
# stream.flush().unwrap(); // --snip-- } else { let status_line = "HTTP/1.1 404 NOT FOUND\r\n\r\n"; let contents = fs::read_to_string("404.html").unwrap(); let response = format!("{}{}", status_line, contents); stream.write(response.as_bytes()).unwrap(); stream.flush().unwrap(); }
# } 範例 20-7: Responding with status code 404 and an error page if anything other than / was requested Here, our response has a status line with status code 404 and the reason phrase NOT FOUND. We’re still not returning headers, and the body of the response will be the HTML in the file 404.html . You’ll need to create a 404.html file next to hello.html for the error page; again feel free to use any HTML you want or use the example HTML in Listing 20-8. 檔案名稱：404.html <!DOCTYPE html>
<html lang="en"> <head> <meta charset="utf-8"> <title>Hello!</title> </head> <body> <h1>Oops!</h1> <p>Sorry, I don't know what you're asking for.</p> </body>
</html> 範例 20-8: Sample content for the page to send back with any 404 response With these changes, run your server again. Requesting 127.0.0.1:7878 should return the contents of hello.html , and any other request, like 127.0.0.1:7878/foo , should return the error HTML from 404.html .

