At the moment the if and else blocks have a lot of repetition: they’re both reading files and writing the contents of the files to the stream. The only differences are the status line and the filename. Let’s make the code more concise by pulling out those differences into separate if and else lines that will assign the values of the status line and the filename to variables; we can then use those variables unconditionally in the code to read the file and write the response. Listing 20-9 shows the resulting code after replacing the large if and else blocks. 檔案名稱：src/main.rs # use std::fs;
# use std::io::prelude::*;
# use std::net::TcpListener;
# use std::net::TcpStream;
# # fn main() {
# let listener = TcpListener::bind("127.0.0.1:7878").unwrap();
# # for stream in listener.incoming() {
# let stream = stream.unwrap();
# # handle_connection(stream);
# }
# }
# // --snip-- fn handle_connection(mut stream: TcpStream) { // --snip-- # let mut buffer = [0; 1024];
# stream.read(&mut buffer).unwrap();
# # let get = b"GET / HTTP/1.1\r\n";
# let (status_line, filename) = if buffer.starts_with(get) { ("HTTP/1.1 200 OK\r\n\r\n", "hello.html") } else { ("HTTP/1.1 404 NOT FOUND\r\n\r\n", "404.html") }; let contents = fs::read_to_string(filename).unwrap(); let response = format!("{}{}", status_line, contents); stream.write(response.as_bytes()).unwrap(); stream.flush().unwrap();
} 範例 20-9: Refactoring the if and else blocks to contain only the code that differs between the two cases Now the if and else blocks only return the appropriate values for the status line and filename in a tuple; we then use destructuring to assign these two values to status_line and filename using a pattern in the let statement, as discussed in Chapter 18. The previously duplicated code is now outside the if and else blocks and uses the status_line and filename variables. This makes it easier to see the difference between the two cases, and it means we have only one place to update the code if we want to change how the file reading and response writing work. The behavior of the code in Listing 20-9 will be the same as that in Listing 20-8. Awesome! We now have a simple web server in approximately 40 lines of Rust code that responds to one request with a page of content and responds to all other requests with a 404 response. Currently, our server runs in a single thread, meaning it can only serve one request at a time. Let’s examine how that can be a problem by simulating some slow requests. Then we’ll fix it so our server can handle multiple requests at once.

383.body:
We’ll look at how a slow-processing request can affect other requests made to our current server implementation. Listing 20-10 implements handling a request to /sleep with a simulated slow response that will cause the server to sleep for 5 seconds before responding. 檔案名稱：src/main.rs # use std::fs;
# use std::io::prelude::*;
# use std::net::TcpListener;
# use std::net::TcpStream;
use std::thread;
use std::time::Duration;
// --snip--
# # fn main() {
# let listener = TcpListener::bind("127.0.0.1:7878").unwrap();
# # for stream in listener.incoming() {
# let stream = stream.unwrap();
# # handle_connection(stream);
# }
# } fn handle_connection(mut stream: TcpStream) { // --snip-- # let mut buffer = [0; 1024];
# stream.read(&mut buffer).unwrap();
# let get = b"GET / HTTP/1.1\r\n"; let sleep = b"GET /sleep HTTP/1.1\r\n"; let (status_line, filename) = if buffer.starts_with(get) { ("HTTP/1.1 200 OK\r\n\r\n", "hello.html") } else if buffer.starts_with(sleep) { thread::sleep(Duration::from_secs(5)); ("HTTP/1.1 200 OK\r\n\r\n", "hello.html") } else { ("HTTP/1.1 404 NOT FOUND\r\n\r\n", "404.html") }; // --snip--
# # let contents = fs::read_to_string(filename).unwrap();
# # let response = format!("{}{}", status_line, contents);
# # stream.write(response.as_bytes()).unwrap();
# stream.flush().unwrap();
