will take a closure of code to run and send it to the already running thread for execution. We’ll also give each worker an id so we can distinguish between the different workers in the pool when logging or debugging. Let’s make the following changes to what happens when we create a ThreadPool. We’ll implement the code that sends the closure to the thread after we have Worker set up in this way: Define a Worker struct that holds an id and a JoinHandle<()>. Change ThreadPool to hold a vector of Worker instances. Define a Worker::new function that takes an id number and returns a Worker instance that holds the id and a thread spawned with an empty closure. In ThreadPool::new, use the for loop counter to generate an id, create a new Worker with that id, and store the worker in the vector. If you’re up for a challenge, try implementing these changes on your own before looking at the code in Listing 20-15. Ready? Here is Listing 20-15 with one way to make the preceding modifications. 檔案名稱：src/lib.rs use std::thread; pub struct ThreadPool { workers: Vec<Worker>,
} impl ThreadPool { // --snip--
