} struct Worker { id: usize, thread: thread::JoinHandle<()>,
} impl Worker { fn new(id: usize) -> Worker { let thread = thread::spawn(|| {}); Worker { id, thread } }
}
# # fn main() {} 範例 20-15: Modifying ThreadPool to hold Worker instances instead of holding threads directly We’ve changed the name of the field on ThreadPool from threads to workers because it’s now holding Worker instances instead of JoinHandle<()> instances. We use the counter in the for loop as an argument to Worker::new, and we store each new Worker in the vector named workers. External code (like our server in src/bin/main.rs ) doesn’t need to know the implementation details regarding using a Worker struct within ThreadPool, so we make the Worker struct and its new function private. The Worker::new function uses the id we give it and stores a JoinHandle<()> instance that is created by spawning a new thread using an empty closure. This code will compile and will store the number of Worker instances we specified as an argument to ThreadPool::new. But we’re still not processing the closure that we get in execute. Let’s look at how to do that next. Sending Requests to Threads via Channels Now we’ll tackle the problem that the closures given to thread::spawn do absolutely nothing. Currently, we get the closure we want to execute in the execute method. But we need to give thread::spawn a closure to run when we create each Worker during the creation of the ThreadPool. We want the Worker structs that we just created to fetch code to run from a queue held in the ThreadPool and send that code to its thread to run. In Chapter 16, you learned about channels —a simple way to communicate between two threads—that would be perfect for this use case. We’ll use a channel to function as the queue of jobs, and execute will send a job from the ThreadPool to the Worker instances, which will send the job to its thread. Here is the plan: The ThreadPool will create a channel and hold on to the sending side of the channel. Each Worker will hold on to the receiving side of the channel. We’ll create a new Job struct that will hold the closures we want to send down the channel. The execute method will send the job it wants to execute down the sending side of the channel. In its thread, the Worker will loop over its receiving side of the channel and execute the closures of any jobs it receives. Let’s start by creating a channel in ThreadPool::new and holding the sending side in the ThreadPool instance, as shown in Listing 20-16. The Job struct doesn’t hold anything for now but will be the type of item we’re sending down the channel. 檔案名稱：src/lib.rs # use std::thread;
