如同第二章提到的，變數預設是不可變的。這是 Rust 推動你能充分利用 Rust 提供的安全性和簡單地並行性來寫程式的許多方法之一。不過，你還是有辦法能讓你的變數成爲可變的。讓我們來探討爲何 Rust 鼓勵你多多使用不可變，以及何時你會想要改爲可變的。 當一個變數是不可變的，只要有數值綁定在一個名字上，你就無法改變其值。爲了方便說明，讓我們使用 cargo new variables 在 projects 目錄下產生一個新專案叫做 variables 。 再來在你的新 variables 目錄下開啓 src/main.rs 然後覆蓋程式碼爲以下內容，這是段還無法編譯的程式碼： 檔案名稱：src/main.rs fn main() { let x = 5; println!("The value of x is: {}", x); x = 6; println!("The value of x is: {}", x);
} 儲存然後使用 cargo run 執行程式。你應該會收到一則錯誤訊息，如下所示： $ cargo run Compiling variables v0.1.0 (file:///projects/variables)
error[E0384]: cannot assign twice to immutable variable `x` --> src/main.rs:4:5 |
2 | let x = 5; | - | | | first assignment to `x` | help: make this binding mutable: `mut x`
3 | println!("The value of x is: {}", x);
4 | x = 6; | ^^^^^ cannot assign twice to immutable variable error: aborting due to previous error For more information about this error, try `rustc --explain E0384`.
error: could not compile `variables`. To learn more, run the command again with --verbose. 此範例顯示了編譯器如何協助你找到你程式碼的錯誤。雖然看到編譯器錯誤訊息總是令人感到沮喪，但這通常是爲了讓你知道你的程式無法安全地完成你想讓它完成的任務。它們 不代表 你不是個優秀的程式設計師！有經驗的 Rustaceans 時常會與編譯器錯誤訊息打交道。 這則錯誤訊息表示錯誤發生的原因：「cannot assign twice to immutable variable x」，因爲你嘗試第二次賦值給 x 變數。 當我們嘗試改變一個原先設計爲不可變的變數時，能夠產生編譯時錯誤是很重要的。因爲這樣的情況很容易導致程式錯誤。如果我們有一部分的程式碼在執行時認爲某個數值絕對不會改變，但另一部分的程式碼卻更改了其值，那麼這就有可能讓前一部分的程式碼就可能以無法預測的方式運行。這樣的程式錯誤的起因是很難追蹤的，尤其是當第二部分的程式碼 偶而 才會改變其值。 在 Rust 中，編譯器會保證當你宣告一個數值不會被改變時，它就絕對不會被改變。這代表當你讀寫程式碼時，你不需要去追蹤該值可能會被改變，讓你的程式碼更容易推導。 但同時可變性也是非常有用的，變數只有預設是不可變的，就如同第二章一樣你可以在變數名稱前面加上 mut 讓它們可以成爲可變的。除了允許改變其值之外，mut 像未來的讀取者表明了其他部分的程式碼將會改變此變數的數值。 舉例來說，讓我們改變 src/main.rs 成以下程式碼： 檔案內容：src/main.rs fn main() { let mut x = 5; println!("The value of x is: {}", x); x = 6; println!("The value of x is: {}", x);
} 當你執行程式的話，我們會得到： $ cargo run Compiling variables v0.1.0 (file:///projects/variables) Finished dev [unoptimized + debuginfo] target(s) in 0.30s Running `target/debug/variables`
The value of x is: 5
The value of x is: 6 當使用 mut 時，我們可以將 x 的數值錯從 5 改變爲 6。有時候比起只有不可變變數，你會想要將某些變數改爲可變的，讓它更容易編寫。 當然除了防止程式錯誤以外，這還有很多權衡取捨。舉例來說，當你擁有一個大型資料結構時，變更其值通常會比複製然後返回重新分配的實例還來的快。不過在比較小的資料結構，用函式程式語言的風格產生新的實例會比較容易思考，所以損失一些效能會比損失閱讀性來得好。

