} 此程式首先將 x 給與 5，然後它用 let x = 遮蔽了 x 變數取代了原本的變數變爲 6。第三次的 let 陳述式一樣遮蔽了 x 讓它將原本的值乘與 2，讓 x 最終的數值爲 12。當我們運行此程式時，當會輸出以下結果： $ cargo run Compiling variables v0.1.0 (file:///projects/variables) Finished dev [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/variables`
