純量 型別代表單一數值。Rust 有四種主要純量型別：整數、浮點數、布林以及字元。你應該在其他程式語言就看過它們了，讓我們來看看它們在 Rust 是怎麼使用的： 整數型別 整數 是沒有小數點的數字。我們在第二章用到了一個整數型別 u32，此型別表示其擁有的數值應該是一個佔 32 位元大小的非帶號整數（帶號整數的話則是用 i 起頭而非 u）。表格 3-1 展示了 Rust 中內建的整數型別。帶號與非帶號的每一變體（比如 i16）都可以用來宣告一個整數數值。 表格 3-1：Rust 中的整數型別 長度 帶號 非帶號 8 位元 i8 u8 16 位元 i16 u16 32 位元 i32 u32 64 位元 i64 u64 128 位元 i128 u128 系統架構 isize usize 每個變體都可以是帶號或非帶號的，並且都有明確的大小。 帶號 與 非帶號 的區別是數字能不能有負數，換句話說就是數字能否帶有正負符號，如果沒有的話那就只會出現正整數而已。就像在紙上寫數字一樣：當我們需要考慮符號時，我們就會在數字前面加上正負號；但如果我們只在意正整數的話，那它可以不帶符號。帶號數字是以 二補數 的方式儲存。 每一帶號變體可以儲存的數字範圍包含從 -(2n - 1) 到 2n - 1 - 1 以內的數字， n 就是該變體佔用的位元大小。所以一個 i8 可以儲存的數字範圍就是錯誤從 -(27) 到 27 - 1，有就是 -128 到 127。而非帶號可以儲存的數字範圍則是從 0 到 2n - 1，所以 u8 可以儲存的範圍是從 0 到 28 - 1，也就是 0 到 255。 另外，isize 與 usize 型別則是依據你程式運行的電腦架構來決定大小：如果你在 64 位元架構上的話就是 64 位元；如果你是 32 位元架構的話就是 32 位元。 你可以用表格 3-2 列的格式來寫出數字的數值。注意除了位元組（Byte）的方式以外，所有的數字數值都允許在最後面加上型別，比如說 57u8。另外也可以加上底線 _ 分隔方便閱讀，比如說 1_000。 表格 3-2：Rust 鐘的整數數值 數字數值 範例 十進制 98_222 十六進制 0xff 八進制 0o77 二進制 0b1111_0000 位元組（僅限u8） b'A' 所以你該用哪些整數型別呢？如果你不確定的話，Rust 預設的型別通常就很好了，整數型別預設是 i32：此型別通常是最快的，甚至在 62 位元系統上也是。而你會用到 isize 或 usize 的主要時機是作爲某些集合的索引。 整數溢位 假設你有個變數型別是 u8 可以儲存 0 到 255 的數值。如果你想要改變變數的值超出這個範圍的話，比方說像是 256，那麼就會發生 整數溢位 。Rust 有一些有趣的規則來處理這項行爲。如果你是在除錯模式編譯的話，Rust 會包含整數溢位的檢查，造成你的程式在運行時 恐慌（panic） 。Rust 使用恐慌來表示程式因錯誤而結束，我們會在第九章的 「對無法復原的錯誤使用 panic!」 段落討論更多造成恐慌的細節。 當你是在發佈模式下用 --release 來編譯的話，Rsut 則 不會 加上整數溢位的檢查而造成恐慌。相反地，如果發生整數溢位的話，Rust 會作出 二補數包裝 的動作。簡單來說，超出最大值的數值可以被 包裝 成該型別的最低數值。以 u8 爲例的話，256 會變成 0、257 會變成 1，以此類推。程式不會恐慌，但是該變數可能會得到一個不是你原本預期的數值。通常依靠整數溢位的行爲仍然會被視爲邏輯錯誤，如果你想要安全顯式表達這種行爲的話，你可以使用標準函式庫的型別 Wrapping 。 浮點數型別 Rust 還有針對有小數點的 浮點數 提供兩種原生型別：f32 和 f64，分別佔有 32 位元與 64 位元的大小。而與設的型別爲 f64，因爲現代的電腦處理的速度幾乎和 f32 一樣卻還能擁有更高的精準度。 以下爲展示浮點數的範例： 檔案名稱：src/main.rs fn main() { let x = 2.0; // f64 let y: f32 = 3.0; // f32
} 浮點數是依照 IEEE-754 所定義的，f32 型別是單精度浮點數，而 f64 是倍精度浮點數。 數值運算 Rust 支援你所有想得到的數值型別基本運算：加法、減法、乘法、除法和取餘。以下程式碼展示出如何在 let 陳述式使用這些運算： 檔案名稱：src/main.rs fn main() { // addition let sum = 5 + 10; // subtraction let difference = 95.5 - 4.3; // multiplication let product = 4 * 30; // division let quotient = 56.7 / 32.2; // remainder let remainder = 43 % 5;
} 每一個陳述式中的表達式都使用了一個數學運算符號並計算出一個數值出來，賦值給該變數。附錄 B 有提供列表列出 Rust 所提供的所有運算子。 布林型別 如同其他多數程式語言一樣，Rust 中的布林型別有兩個可能的值：true 和 false。布林值的大小爲一個位元組。要在 Rust 中定義布林型別的話用 bool，如範例所示： 檔案名稱：src/main.rs fn main() { let t = true; let f: bool = false; // with explicit type annotation
} 布林值最常使用的方式之一是作爲條件判斷，像是在 if 表達式中使用。我們將會在 「控制流」 段落介紹如何在 Rust 使用 if 表達式。 字元型別 目前我們只討論了數字，但是 Rust 一樣也有支援字母。Rust 的 char 型別是最原生的字母型別，以下程式碼顯示了使用它的方法。（請注意到 char 是用單撇號賦值，宣告字串時才是用雙撇號） 檔案名稱：src/main.rs fn main() { let c = 'z'; let z = 'ℤ'; let heart_eyed_cat = '😻';
} Rust 的 cahr 型別大小爲四個位元組並表示爲一個 Unicode 純量數值，這代表它能擁有的字元比 ASCII 還來的多。舉凡標音字母（Accented letters）、中文、日文、韓文、表情符號以及零長度空格都 Rust cahr 的有效字元。Unicode 純量數值的範圍包含從 U+0000 到 U+D7FF 以及 U+E000 到 U+10FFFF。但是一個「字元」並不是真正的 Unicode 概念，所以你對於什麼是一個「字元」的看法可能會和 Rust 的 char 不一樣。我們將會在第八章的 「用字串儲存 UTF-8 編碼的文字」 來討論此議題。

