複合型別 可以組合數個數值爲一個型別，Rust 有兩個原生複合型別：元組（tuples）和陣列（arrays）。 元組型別 元組是個將許多不同型別的數值合成一個複合型別的常見方法。元組擁有固定長度：一旦宣告好後，它們就無法增長或縮減。 我們建立一個元組的方法是寫一個用括號囊刮起來的數值列表，每個值再用逗號分隔開來。元組的每一格都是一個獨立型別，不同數值不必是相同型別。以下範例我們也加上了型別詮釋，平時不一定要加上： 檔案名稱：src/main.rs fn main() { let tup: (i32, f64, u8) = (500, 6.4, 1);
} 此變數 tup 就是整個元組，因爲一個元組就被視爲單一複合元素。要拿到元組中的每個獨立數值的話，我們可以用模式配對（pattern matching）來解構一個元組的數值，如以下所示： 檔案名稱：src/main.rs fn main() { let tup = (500, 6.4, 1); let (x, y, z) = tup; println!("The value of y is: {}", y);
} 此程式先是建立了一個元組然後賦值給 tup，接著它用模式配對和 let 將 tup 拆成三個個別的變數 x、y 和 z。這就叫做 解構（destructuring） ，因爲它將單一元組拆成了三個部分。最後程式將 y 的值印出來，也就是 6.4。 除了用模式配對解構元組以外，我們也可以直接用句號（.）在加上數值的索引來取得元組內的元素。舉例來說： 檔案名稱：src/main.rs fn main() { let x: (i32, f64, u8) = (500, 6.4, 1); let five_hundred = x.0; let six_point_four = x.1; let one = x.2;
} 此程式建立了元組 x，然後用它們個別的索引產生新的變數。和多數程式語言一樣，元組的第一個索引是 0。 陣列型別 另一種取得數個數值集合的方法是使用 陣列 。和元組不一樣的是，陣列中的每個型別必須是一樣的。Rust 中的陣列和一些其他語言的陣列會有點不同，因爲 Rust 的陣列是固定長度的，就和元組一樣。 在 Rust 中，陣列的寫法是將數值寫在中括號內，每個數值再用逗號區隔開來： 檔案名稱：src/main.rs fn main() { let a = [1, 2, 3, 4, 5];
} 當你想要你的資料被分配在堆疊（stack）而不是堆積（heap）的話，使用陣列是很好的選擇（我們會在第四章討論堆疊與堆積的內容）。或者當你想確定你永遠會取得固定長度的元素也是。所以陣列不像 Vector 型別那麼有彈性， Vector 是標準函式庫提供的集合型別，類似於陣列但 允許 變更長度大小。如果你不確定該用陣列或 Vector 的話，通常你應該用 Vector 就好。第八章將會討論更多 Vector 的細節。 你會想用到陣列而非 Vector 的時機，可能會像是以下要取得一年之中的每個月份的例子這樣。這樣的列表很可能永遠不需要新增或刪除月份，所以你可以選擇用陣列宣告，因爲永遠只會有 12 個月份： let months = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"]; 要詮釋陣列型別的話，你可以在中括號寫出型別和元素數量，並用分號區隔開來，如以下所示： let a: [i32; 5] = [1, 2, 3, 4, 5]; i32 在此是每個元素的型別，在分號後面的數字 5 指的是此陣列有五個元素。 這種寫法和初始化陣列數值的另一種寫法很像：如果你想建立的陣列中每個元素數值都一樣的話，你可以指定一個數值後加上分號，最後寫出元素數量。如以下所示： let a = [3; 5]; 陣列 a 會包含 5 個元素，然後每個元素的初始化數值均爲 3。這樣寫與 let a = [3, 3, 3, 3, 3]; 的寫法一樣，但比較簡潔。 獲取陣列元素 一個陣列是被分配載堆疊上的一整塊記憶體，你可以用索引來取得陣列的元素，比如： 檔案名稱：src/main.rs fn main() { let a = [1, 2, 3, 4, 5]; let first = a[0]; let second = a[1];
} 在此範例中，變數 first 會得到數值 1，因爲這是陣列索引 [0] 的數值。變數 second 則會從陣列索引 [1] 得到數值 2。 無效的陣列元素存取 如果我們存取陣列之後的元素會發生什麼事呢？假設你修改範例成以下程式碼的話，雖然可以編譯通過但是在執行時則會出現錯誤： 檔案名稱：src/main.rs fn main() { let a = [1, 2, 3, 4, 5]; let index = 10; let element = a[index]; println!("The value of element is: {}", element);
} 使用 cargo run 執行程式會產生以下結果： $ cargo run Compiling arrays v0.1.0 (file:///projects/arrays) Finished dev [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/arrays`
thread 'main' panicked at 'index out of bounds: the len is 5 but the index is 10', src/main.rs:5:19
note: run with `RUST_BACKTRACE=1` environment variable to display a backtrace. 編譯期間沒有產生任何錯誤，但程式會產生*執行時（runtime）*錯誤並無法正確離開。當你嘗試使用索引存取元素時，Rust 會檢查你的索引是否小於陣列長度，如果索引大於或等於陣列長度的話，Rust 就會恐慌。 這是你第一個在實例中看到 Rust 安全原則給予的保障。在許多低階語言並不會提供這樣的檢查，所以當你提供不正確的索引時，無效的記憶體可能會被存取。Rust 會保護你免於這樣的錯誤風險，並立即離開程式，而不是允許記憶體存取並繼續。第九章將會討論更多有關 Rust 的錯誤處理方式。 translators: [Ngô͘ Io̍k-ūi wusyong9104@gmail.com ] commit: 88250d6 updated: 2020-09-05

53.body:
函式在 Rust 程式碼中無所不在。你已經見過一個語言最重要的函式了：main 函式是許多程式的入口點。此外你也看到了 fn 關鍵字能讓你宣告新的函式。 Rust 程式碼使用 snake case 作爲函式與變數名稱的慣例風格。在 snake case 中，所有的字母都是小寫，並用底線區隔單字。以下是一支包含函式定義範例的程式： 檔案名稱：src/main.rs fn main() { println!("Hello, world!"); another_function();
} fn another_function() { println!("Another function.");
} Rust 的函式定義從 fn 開始且在函式名稱後會有一組括號，大括號告訴編譯器函式本體的開始與結束位置。 我們可以輸入函式的名稱並加上括號來呼叫任何我們定義過的函式。因爲 another_function 已經在程式中定義了，他就可以在 main 函式中呼叫。注意到我們是在原始程式碼中的 main 函式 之後 定義 another_function 的，我們當然也可以把它定義在前面。Rust 不在乎你的函式是在哪裡定義的，只需要知道它在某處有定義就好。 讓我們開啓一個新的專案叫做 functions 來進一步探索。請將 another_function 範例放入 src/main.rs 然後執行它。你應該會看到以下輸出： $ cargo run Compiling functions v0.1.0 (file:///projects/functions) Finished dev [unoptimized + debuginfo] target(s) in 0.28s Running `target/debug/functions`
Hello, world!
Another function. 程式碼會按照 main 函式中的順序執行。首先，「Hello, world!」的訊息會先顯示出來，再來才會呼叫 another_function 並印出它的訊息。

54.body:
函式也可以被定義成擁有 參數（parameters） 的，這是函式（signatures）中特殊的變數。當函式有參數時，你可以提供那些參數的確切數值。嚴格上來說，我們傳遞的數值會叫做 引數（arguments） 。但爲了方便起見，通常大家不太會去在意兩者的區別。雖然函式定義時才叫 參數 ，傳遞數值時叫做 引數 ，但很多時候會被人們拿來交互使用。 以下是加上參數後重新寫過的 another_function 範例： 檔案名稱：src/main.rs fn main() { another_function(5);
} fn another_function(x: i32) { println!("The value of x is: {}", x);
} 嘗試執行程式的話，你應該會看到以下輸出結果： $ cargo run Compiling functions v0.1.0 (file:///projects/functions) Finished dev [unoptimized + debuginfo] target(s) in 1.21s Running `target/debug/functions`
The value of x is: 5 宣告 another_function 時有一個參數叫做 x，而 x 的型別被指定爲 i32。當我們傳遞 5 給 another_function 時，println! 巨集會將 5 置於格式化字串中的大括號的位置。 在函式簽名中，你 必須 宣告每個參數的型別，這是 Rust 謹慎考慮後的設計決定：在函式定義中要求型別詮釋，代表編譯器幾乎不需要你在其他地方再提供資訊才能知道你要做什麼。 如果你希望函式擁有數個參數，你可以用逗號區隔開來，像這樣： 檔案名稱：src/main.rs fn main() { another_function(5, 6);
} fn another_function(x: i32, y: i32) { println!("The value of x is: {}", x); println!("The value of y is: {}", y);
} 此範例建立了一個有兩個參數的函式，兩個都是 i32 型別。接著函式在印出兩個參數的數值，注意參數不必得是相同的形態，這只是我們在此範例這樣寫而已。 讓我們試著執行此程式碼，請覆蓋你的專案 functions 內的 src/main.rs 檔案內容爲以上範例，然後用 cargo run 執行程式： $ cargo run Compiling functions v0.1.0 (file:///projects/functions) Finished dev [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/functions`
The value of x is: 5
The value of y is: 6 因爲我們呼叫函式時，將 5 給了 x 且將 6 給了 y，字串就會印出這些數值。

55.body:
函式本體是由一系列的陳述式（statements）並在最後可以選擇加上表達式（expression）來組成。目前我們只講了沒有用到表達式做結尾的函式。由於 Rust 是門基於表達式（expression-based）的語言，知道這樣的區別是很重要的。其他語言通常沒有這樣的區別，所以現在讓我們來看看陳述式和表達式有什麼不同，以及它們怎麼影響函式本體。 我們其實已經使用了很多次陳述式與表達式。*陳述式（Statements）*是進行一些動作的指令，且不回傳任何數值。*表達式（Expressions）*則是計算並產生數值。讓我們來看一些範例： 建立一個變數然後用 let 關鍵字賦值給它就是一道陳述式。在範例 3-1 中的 let y = 6; 就是個陳述式。 檔案名稱：src/main.rs fn main() { let y = 6;
} 範例 3-1：包含一道陳述式的 main 函式宣告 此函式定義也是陳述式，整個範例就是本身就是一個陳述式。 陳述式不會回傳數值，因此你無法將 let 陳述式賦值給其他變數。如同以下程式碼所做的，你將會得到一個錯誤： 檔案名稱：src/main.rs fn main() { let x = (let y = 6);
} 當你執行此程式時，你就會看到這樣的錯誤訊息： $ cargo run Compiling functions v0.1.0 (file:///projects/functions)
error: expected expression, found statement (`let`) --> src/main.rs:2:14 |
2 | let x = (let y = 6); | ^^^ | = note: variable declaration using `let` is a statement let y = 6 陳述式不回傳數值，所以 x 得不到任何數值。這就和其他語言有所不同，像是 C 或 Ruby，通常它們的賦值仍能回傳所得到的值。在那些語言，你可以寫 x = y = 6 同時讓 x 與 y 都取得 6，但在 Rust 就不行。 表達式則會運算出些東西，並組合成你大部分所寫的 Rust 程式。先想想看一個簡單的數學運算比如 5 + 6，這就是個會算出 11 的表達式。表達式可以是陳述式的一部分：在範例 3-1 中 let y = 6; 的 6 其是就是個算出 6 的表達式。呼叫函式也可以是表達式、呼叫巨集也是表達、我們用 {} 產生的作用域也是表達式。舉例來說： 檔案名稱：src/main.rs fn main() { let x = 5; let y = { let x = 3; x + 1 }; println!("The value of y is: {}", y);
} 此表達式： { let x = 3; x + 1
} 就是一個會回傳 4 的區塊，此值再用 let 陳述式賦值給 y。請注意到 x + 1 這行沒有加上分號，它和你目前看到的寫法有點不同，因爲表達式結尾不會加上分號。如果你在此表達式加上分號的話，它就不會回傳數值。在我們繼續探討函式回傳值與表達式的同時請記住這一點。

56.body:
函式可以回傳數值給呼叫它們的程式碼，我們不會爲回傳值命名，但我們會用箭頭（->）來宣告它們的型別。在 Rust 中，回傳值其實就是函式本體最後一行的表達式。你可以用 return 關鍵字加上一個數值來提早回傳函式，但多數函式都能用最後一行的表達式作爲數值回傳。以下是一個有回傳數值的函式範例： 檔案名稱：src/main.rs fn five() -> i32 { 5
} fn main() { let x = five(); println!("The value of x is: {}", x);
} 在 five 函式中沒有任何函式呼叫、巨集甚至是 let 陳述式，只有一個 5。這在 Rust 中完全是合理的函式。請注意到函式的回傳型別也有指明，就是 -> i32。嘗試執行此程式的話，輸出結果就會像是這樣： $ cargo run Compiling functions v0.1.0 (file:///projects/functions) Finished dev [unoptimized + debuginfo] target(s) in 0.30s Running `target/debug/functions`
The value of x is: 5 five 中的 5 就是函式的回傳值，這就是爲何回傳型別是 i32。讓我們進一步研究細節，這邊有兩個重要的地方：首先這行 let x = five(); 顯示了我們用函式的回傳值作爲變數的初始值。因爲函式 five 回傳 5，所以這行和以下程式碼相同： let x = 5; 再來，five 函式沒有參數但有定義回傳值的型別。所以函式本體只需有一個 5 就好，不需加上分號，這樣就能當做表達式回傳我們想要的數值。 讓我們在看另一個例子： 檔案名稱：src/main.rs fn main() { let x = plus_one(5); println!("The value of x is: {}", x);
} fn plus_one(x: i32) -> i32 { x + 1
} 執行此程式會顯示 The value of x is: 6，但如果我們在最後一行 x + 1 加上分號的話，就會將它從表達式變爲陳述式。我們就會得到錯誤。 檔案名稱：src/main.rs fn main() { let x = plus_one(5); println!("The value of x is: {}", x);
} fn plus_one(x: i32) -> i32 { x + 1;
} 編譯此程式就會產生以下錯誤： $ cargo run Compiling functions v0.1.0 (file:///projects/functions)
error[E0308]: mismatched types --> src/main.rs:7:24 |
7 | fn plus_one(x: i32) -> i32 { | -------- ^^^ expected `i32`, found `()` | | | implicitly returns `()` as its body has no tail or `return` expression
8 | x + 1; | - help: consider removing this semicolon error: aborting due to previous error For more information about this error, try `rustc --explain E0308`.
error: could not compile `functions`. To learn more, run the command again with --verbose. 錯誤訊息「mismatched types」就告訴了我們此程式碼的核心問題。plus_one 的函式定義說它會回傳 i32 但是陳述式不會回傳任何數值。我們用空元組 () 表示不會回傳任何值。因此沒有任何值被回傳，這和函式定義相牴觸，最後產生錯誤。在此輸出結果，Rust 提供了一道訊息來協助解決問題：它建議移除分號，這樣就能修正錯誤。 translators: [Ngô͘ Io̍k-ūi wusyong9104@gmail.com ] commit: d44317c updated: 2020-09-05

57.body:
所有程式設計師均致力於讓他們的程式碼易於閱讀，不過有時後額外的解釋還是需要的。這種情況下，開發者會在他們的程式碼留下一些筆記或是 註解（comments） ，編譯器會忽略這些字，但其他人在閱讀程式碼時可能就會覺得很有幫助。 這是一個簡單地註釋： // hello, world 在 Rust 中，理想的註解風格是用兩行斜線在加上一個空格起頭，然後註解就能一直寫到該行結束爲止。如果註解會超過一行的話，你需要在每一行都加上 //，如下所示： // So we’re doing something complicated here, long enough that we need
// multiple lines of comments to do it! Whew! Hopefully, this comment will
// explain what’s going on. 註解也可以加載程式碼之後： 檔案名稱：src/main.rs fn main() { let lucky_number = 7; // I’m feeling lucky today
} 不過你會更常看到它們用用以下格式，註解會爲於要說明的程式碼上一行： 檔案名稱：src/main.rs fn main() { // I’m feeling lucky today let lucky_number = 7;
} Rust 還有另一種註解：技術文件註解。我們會在第十四章的「發佈 Crate 到 Crates.io」段落提到它。 translators: [Ngô͘ Io̍k-ūi wusyong9104@gmail.com ] commit: 25a1530 updated: 2020-09-06

59.body:
An if expression allows you to branch your code depending on conditions. You provide a condition and then state, “If this condition is met, run this block of code. If the condition is not met, do not run this block of code.” Create a new project called branches in your projects directory to explore the if expression. In the src/main.rs file, input the following: 檔案名稱：src/main.rs fn main() { let number = 3; if number < 5 { println!("condition was true"); } else { println!("condition was false"); }
} All if expressions start with the keyword if, which is followed by a condition. In this case, the condition checks whether or not the variable number has a value less than 5. The block of code we want to execute if the condition is true is placed immediately after the condition inside curly brackets. Blocks of code associated with the conditions in if expressions are sometimes called arms , just like the arms in match expressions that we discussed in the “Comparing the Guess to the Secret Number” section of Chapter 2. Optionally, we can also include an else expression, which we chose to do here, to give the program an alternative block of code to execute should the condition evaluate to false. If you don’t provide an else expression and the condition is false, the program will just skip the if block and move on to the next bit of code. Try running this code; you should see the following output: $ cargo run Compiling branches v0.1.0 (file:///projects/branches) Finished dev [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/branches`
condition was true Let’s try changing the value of number to a value that makes the condition false to see what happens: # fn main() { let number = 7;
# # if number < 5 {
# println!("condition was true");
# } else {
# println!("condition was false");
# }
# } Run the program again, and look at the output: $ cargo run Compiling branches v0.1.0 (file:///projects/branches) Finished dev [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/branches`
condition was false It’s also worth noting that the condition in this code must be a bool. If the condition isn’t a bool, we’ll get an error. For example, try running the following code: 檔案名稱：src/main.rs fn main() { let number = 3; if number { println!("number was three"); }
} The if condition evaluates to a value of 3 this time, and Rust throws an error: $ cargo run Compiling branches v0.1.0 (file:///projects/branches)
error[E0308]: mismatched types --> src/main.rs:4:8 |
4 | if number { | ^^^^^^ expected `bool`, found integer error: aborting due to previous error For more information about this error, try `rustc --explain E0308`.
error: could not compile `branches`. To learn more, run the command again with --verbose. The error indicates that Rust expected a bool but got an integer. Unlike languages such as Ruby and JavaScript, Rust will not automatically try to convert non-Boolean types to a Boolean. You must be explicit and always provide if with a Boolean as its condition. If we want the if code block to run only when a number is not equal to 0, for example, we can change the if expression to the following: 檔案名稱：src/main.rs fn main() { let number = 3; if number != 0 { println!("number was something other than zero"); }
} Running this code will print number was something other than zero. Handling Multiple Conditions with else if You can have multiple conditions by combining if and else in an else if expression. For example: 檔案名稱：src/main.rs fn main() { let number = 6; if number % 4 == 0 { println!("number is divisible by 4"); } else if number % 3 == 0 { println!("number is divisible by 3"); } else if number % 2 == 0 { println!("number is divisible by 2"); } else { println!("number is not divisible by 4, 3, or 2"); }
} This program has four possible paths it can take. After running it, you should see the following output: $ cargo run Compiling branches v0.1.0 (file:///projects/branches) Finished dev [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/branches`
number is divisible by 3 When this program executes, it checks each if expression in turn and executes the first body for which the condition holds true. Note that even though 6 is divisible by 2, we don’t see the output number is divisible by 2, nor do we see the number is not divisible by 4, 3, or 2 text from the else block. That’s because Rust only executes the block for the first true condition, and once it finds one, it doesn’t even check the rest. Using too many else if expressions can clutter your code, so if you have more than one, you might want to refactor your code. Chapter 6 describes a powerful Rust branching construct called match for these cases. Using if in a let Statement Because if is an expression, we can use it on the right side of a let statement, as in Listing 3-2. 檔案名稱：src/main.rs fn main() { let condition = true; let number = if condition { 5 } else { 6 }; println!("The value of number is: {}", number);
} 範例 3-2: Assigning the result of an if expression to a variable The number variable will be bound to a value based on the outcome of the if expression. Run this code to see what happens: $ cargo run Compiling branches v0.1.0 (file:///projects/branches) Finished dev [unoptimized + debuginfo] target(s) in 0.30s Running `target/debug/branches`
