Another useful feature of impl blocks is that we’re allowed to define functions within impl blocks that don’t take self as a parameter. These are called associated functions because they’re associated with the struct. They’re still functions, not methods, because they don’t have an instance of the struct to work with. You’ve already used the String::from associated function. Associated functions are often used for constructors that will return a new instance of the struct. For example, we could provide an associated function that would have one dimension parameter and use that as both width and height, thus making it easier to create a square Rectangle rather than having to specify the same value twice: 檔案名稱：src/main.rs # #[derive(Debug)]
# struct Rectangle {
# width: u32,
# height: u32,
# }
# impl Rectangle { fn square(size: u32) -> Rectangle { Rectangle { width: size, height: size, } }
}
# # fn main() {
# let sq = Rectangle::square(3);
# } To call this associated function, we use the :: syntax with the struct name; let sq = Rectangle::square(3); is an example. This function is namespaced by the struct: the :: syntax is used for both associated functions and namespaces created by modules. We’ll discuss modules in Chapter 7.

